package com.example.soptseminar3.webtoon


import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import com.example.soptseminar3.R
import kotlinx.android.synthetic.main.fragment_monday.*

/**
 * A simple [Fragment] subclass.
 */
class Monday : Fragment() {

    var datas= mutableListOf<WebtData>()
    lateinit var webtAdapter: WebtAdapter
    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_monday, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)
        webtAdapter= WebtAdapter(view.context)
        recy_monday.adapter=webtAdapter
        recy_monday.addItemDecoration(WebtDeco())
        loadDatas()
    }

    private fun loadDatas() {
        datas.apply {
            add(WebtData("유미의 세포들", "이동건", "data:image/jpeg;base64,"))
            add(WebtData("백수세끼","작가","data:image/jpeg;base64,"))
            add(WebtData("신의 탑","시우","data:image/jpeg;base64,"))
            add(WebtData("유미의 세포들", "작가", "data:image/jpeg;base64,"))
            add(WebtData("백수세끼","김가영","data:image/jpeg;base64,"))
            add(WebtData("신의 탑","시우","data:image/jpeg;base64,"))
            add(WebtData("유미의 세포들", "작가", "data:image/jpeg;base64,"))
            add(WebtData("백수세끼","김가영","data:image/jpeg;base64,"))
            add(WebtData("신의 탑","시우","data:image/jpeg;base64,"))
        }
        webtAdapter.datas=datas
        webtAdapter.notifyDataSetChanged()
    }
}
